import React from "react";
import { Link } from "react-router-dom";
//import App from "../app";
//import Navigation from "../app";

class Navigation extends React.Component {
  render() {
    return (
      <nav class="navbar navbar-expand-md">
        <ul class="navbar-nav">
          <li><a class="nav-link" href="./index.html">Index</a></li>
          <li><a class="nav-link" href="./search.html">Search</a></li>
          <li><a class="nav-link" href="./submit.html">Submit</a></li>
        </ul>
      </nav>
    )
  };
};

  
//Functional Component 
const MainPage = () => {
  return (
    <div>
      <h3>Welcome to the React Router Tutorial</h3>
      <small>Main Page</small>
      <Navigation />
      <Link to="/users">Show List of Users</Link>
    </div>
  );
};

export default MainPage;
